const encode = encodeURIComponent;
for (const item of $input.all()) {
  item.json.Keyword = encode(item.json.Keyword);
}
return $input.all();

// Parse the HTML response from Scrape.do
const html = $input.first().json.data || $input.first().json.body || '';

const results = [];

// Simple regex patterns to extract search results
// Pattern for organic results
const resultPattern = /<div[^>]*class=\"[^\"]*Ww4FFb[^\"]*\"[^>]*>([\s\S]*?)<\/div>/gi;
const matches = html.matchAll(resultPattern);

let position = 1;
for (const match of matches) {
  const resultHtml = match[1];

  // Extract title (h3 tag)
  const titleMatch = resultHtml.match(/<h3[^>]*>([^<]*)<\/h3>/i);
  const title = titleMatch ? titleMatch[1].replace(/<[^>]*>/g, '').trim() : '';

  // Extract URL
  const urlMatch = resultHtml.match(/href=\"([^\"]+)\"/i);
  const url = urlMatch ? urlMatch[1] : '';

  // Extract description
  const descMatch = resultHtml.match(/<div[^>]*class=\"[^\"]*VwiC3b[^\"]*\"[^>]*>([^<]*)</i);
  const description = descMatch ? descMatch[1].replace(/<[^>]*>/g, '').trim() : '';

  if (title && url) {
    results.push({
      position: position++,
      websiteTitle: title,
      websiteUrl: url,
      websiteDescription: description || 'No description available',
      keyword: $input.first().json.originalKeyword || $input.first().json.Keyword || ''
    });
  }

  // Stop after 10 organic results
  if (position > 10) break;
}

// If no results found with the above method, try a simpler approach
if (results.length === 0) {
  // Look for any links that appear to be search results
  const linkPattern = /<a[^>]*href=\"(https?:\/\/[^\"]+)\"[^>]*>([^<]+)<\/a>/gi;
  const linkMatches = html.matchAll(linkPattern);

  position = 1;
  for (const linkMatch of linkMatches) {
    const url = linkMatch[1];
    const title = linkMatch[2].replace(/<[^>]*>/g, '').trim();

    // Filter out Google's own links
    if (url && !url.includes('google.com') && !url.includes('googleapis.com')) {
      results.push({
        position: position++,
        websiteTitle: title || 'No title',
        websiteUrl: url,
        websiteDescription: 'Description not available',
        keyword: $input.first().json.originalKeyword || $input.first().json.Keyword || ''
      });

      if (position > 10) break;
    }
  }
}

// Return results or a default if none found
return results.length > 0 ? results.map(r => ({json: r})) : [{json: {
  position: 1,
  websiteTitle: 'No results found',
  websiteUrl: 'N/A',
  websiteDescription: 'Please check the HTML response',
  keyword: $input.first().json.originalKeyword || $input.first().json.Keyword || '',
  htmlLength: html.length
}}];
